import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import ConnexionApp from './connexion/ConnexionApp.js';

class App extends React.Component {
  render() {
    return (
      <div>
        <Router>
          <Routes>
            <Route exact path="/" element={<ConnexionApp />} />
            <Route exact path="/About" element={<ConnexionApp />} />
            <Route exact path="/Connexion" element={<ConnexionApp />} />
          </Routes>
        </Router>
      </div>
    );
  }
}

export default App;
